  \"Operational Assessment of Controller Complexity Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:04:23.386728\",\n\t\"name\": \"operational-assessment-of-controller-complexity-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In today's operations, acceptable levels
  of controller workload are maintained by assigning sector capacities based on simple
  aircraft count and a capacity threshold known as the monitor alert parameter (MAP).
  The MAP value of a sector is typically 5/3 of average sector flight time (or dwell
  time) measured in minutes, but may be adjusted up or down as necessary to account
  for other considerations such as sector geometry, traffic mix, and phase of flight.
  Future operations may utilize complexity as a proxy for workload instead. Our proposed
  research builds upon existing NASA complexity metrics by analyzing operational data
  to validate the factors that contribute to complexity in actual operations. We believe
  we have formulated a novel validation approach to apply to complexity. Our goal
  is to analyze a large sampling of operational data (substantially larger than could
  ever be provided by human-in-the-loop simulations) for a wide range of distinct
  sector types within Center airspace. This large and diverse sampling is anticipated
  to provide statistical significance to the validation of complexity factors. Most
  importantly, we believe that demonstrating sound operational validation of complexity
  is a key step in enabling the transition from aircraft count-based capacity to complexity-based
  capacity.rnThe first objective is to develop a capability to analyze operational
  data that can identify sectors whose MAP value deviates from the 5/3 dwell time
  rule. These sectors will likely exhibit complexity that is higher or lower than
  the nominal complexity associated with a given MAP value. The next objective is
  to determine which complexity factors are positively or negatively influencing the
  sector capacity deviation from the 5/3 dwell time rule from the training set of
  operational sectors. The final objective is to validate that the complexity factors
  identified can accurately predict deviations from the 5/3 dwell time rule for the
  validation set of operational sectors. rn\",\n\t\"license_title\": \"U.S. Government
